  null,\n\t\"notes\": \"This is an unpublished report on the bird avoidance model
  to predict bird strike hazards with low flying aircraft. Included is peak periods
  for different species of birds at Santee National Wildlife Refuge. The U.S. Air
  Force's Bird Aircraft Strike Hazard (BASH) Team is updating a Bird Avoidance Model
  (BAM) to predict and evaluate potential bird hazards for low-flying aircraft and
  to assess environmental impacts. The BAM will include the migratory and resident
  bird population data which is largely responsible for theannual loss of millions
  of dollars in flight resources. It is important for us to gather and maintain the
  best data on bird movements and distribution. Biological and geographical data will
  be integrated using aGeographical Information System (GIS). We realize how dynamic
  the refuge bird populations are, but with your help we can make recommendations
  to avoid overflight of specific areas during potentially hazardous periods or where
  sensitive species may occur.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
